import React from 'react';
import './App.css';
import Header from './components/Header/Header';
import Shop from './components/Shop/Shop';
import {
  BrowserRouter as Router,
  Route,
  Link,
  Routes,
  BrowserRouter
} from "react-router-dom";


function App() {
  return (
    <div>
      <Header></Header>       
          <Routes>
            <Route path="/shop"><Shop></Shop></Route>
            </Routes>


    </div>
  );
}


export default App;
